export default {

    authorize(login_input, password_input) {
        fetch('http://192.168.0.7:8080/api/auth/login.php', {
          method: 'POST',
            mode: "cors",
          headers: {
              'Access-Control-Allow-Origin':'*',
              'Content-Type': 'application/json'
          },
          body: JSON.stringify({login: login_input, password: password_input})
        }).then(data => console.log(data.ok))

        // return await resp.text()
    }
}
